import React from 'react';

import { alertmessage } from './../notification/Info'
 
class Example extends React.Component {
 
  render() {
    return (
      <div>
        <button className='btn btn-info'
          onClick={alertmessage.createNotification('info')}>Info
        </button>
        <hr/>
        <button className='btn btn-success'
          onClick={alertmessage.createNotification('success')}>Success
        </button>
        <hr/>
        <button className='btn btn-warning'
          onClick={alertmessage.createNotification('warning')}>Warning
        </button>
        <hr/>
        <button className='btn btn-danger'
          onClick={alertmessage.createNotification('error')}>Error
        </button>
 
        <NotificationContainer/>
      </div>
    );
  }
}
 
export default Example;
